import styled from "styled-components";

export const Head = styled.div`
	background-color: ${(props) => props.color};
	padding: 25px 30px;
`;
export const HomeProfile = styled.h1`
	font-size: 1.5em;
	color: whitesmoke;
	text-align: start;
	/* color: palevioletred; */
	margin: 0;
	float: left;
`;

export const ProfileAvatar = styled.div`
	text-align: end;
	color: black;
`;

export const Avatar = styled.p`
