	margin: 0;
	display: initial;
	background-color: rebeccapurple;
	padding: 10px;
	border-radius: 100px;
	color: wheat;
`;

export const Foot = styled.div`
	background-color: ${(props) => props.color};
	padding: 15px 0px;
	left: 0%;
	width: 100%;
	bottom: 0;
`;

export const MyName = styled.div`
	text-align: end;
	margin-right: 20px;
`;

export const TextDetail = styled.div`
	flex-flow: wrap;
	display: flex;
	justify-content: space-between;
`;

export const ALlDetail = styled.div`
	margin-top: 20px;
	position: relative;
	height: 100%;
	color: black;
`;

export const PlainText = styled.p`
	margin: 0 20px;
	color: black;
`;

export const Button = styled.button`
	border: 5em;
	position: absolute;
	bottom: 30px;
	cursor: pointer;
	outline: none;
	font-size: 16px;
	-webkit-transform: translate(0);
	transform: translate(0);
	background-image: linear-gradient(45deg, #4568dc, #b06ab3);
	padding: 0.7em 2em;
	border-radius: 65px;
	box-shadow: 1px 1px 10px rgba(255, 255, 255, 0.438);
	-webkit-transition: box-shadow 0.25s;
	transition: box-shadow 0.25s;
	color: white;
	&:hover {
		background-image: linear-gradient(-45deg, #4568dc, #b06ab3);
		box-shadow: 0 12px 24px rgba(128, 128, 128, 0.1);
	}
`;

const AllListRes = styled.div`
	flex-flow: wrap;
	display: flex;
	justify-content: space-around;
	padding: 0;
	margin: 0;
	list-style: none;
	/* padding-bottom: 10px; */
`;

const Item = styled.div`
	background: white;
	border-radius: 10px;
	padding: 5px;
	width: 250px;
	height: 400px;
	margin-top: 10px;
	/* line-height: 150px; */
	color: white;
	/* font-weight: bold; */
	/* font-size: 3em; */
